import React, { useState } from 'react';
import './App.css';
import { DropdownButton, Dropdown, Nav, Offcanvas } from 'react-bootstrap';

function NavBar() {
  return (
    <Dropdown className="d-flex justify-content-end">
      <DropdownButton variant="light" align="end" title="menu" id="dropdown-menu-align-end">
        <Dropdown.Item eventKey="1" className="menu-drop1">
          <a href="/">Home</a>
        </Dropdown.Item>

        <Dropdown.Divider />

        <Dropdown.Item eventKey="2" className="menu-drop2">
          <a href="/">Weekly Planner</a>
        </Dropdown.Item>

        <Dropdown.Item eventKey="3" className="menu-drop3">
          <a href="/">Habit Tracker</a>
        </Dropdown.Item>
      </DropdownButton>
    </Dropdown>
  );
}

export default NavBar
